import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Footer from './Footer';

const Landing = () => {
  const navigate = useNavigate();
  const [dogeMoveX, setDogeMoveX] = useState(0);
  const [dogeMoveY, setDogeMoveY] = useState(0);
  const [selectedMeme, setSelectedMeme] = useState(null);

  useEffect(() => {
    const handleMouseMove = (e) => {
      const x = (e.clientX - window.innerWidth / 2) / 50;
      const y = (e.clientY - window.innerHeight / 2) / 50;
      setDogeMoveX(x);
      setDogeMoveY(y);
    };

    window.addEventListener('mousemove', handleMouseMove);
    return () => window.removeEventListener('mousemove', handleMouseMove);
  }, []);

  // Sample meme data
  const memeGallery = [
    {
      title: "Diamond Hands",
      description: "HODL Forever! üíéüôå",
      emoji: "üíé"
    },
    {
      title: "To The Moon",
      description: "Next stop: Luna! üöÄ",
      emoji: "üöÄ"
    },
    {
      title: "Wen Lambo",
      description: "Soon‚Ñ¢ üèéÔ∏è",
      emoji: "üèéÔ∏è"
    },
    {
      title: "WAGMI",
      description: "We're All Gonna Make It! üåü",
      emoji: "üåü"
    },
    {
      title: "Doge Life",
      description: "Much wow, very profit üêï",
      emoji: "üêï"
    },
    {
      title: "Paper Hands",
      description: "Not welcome here! üìÑ",
      emoji: "üìÑ"
    },
    {
      title: "Buy The Dip",
      description: "Tasty discounts! üìâ",
      emoji: "üìâ"
    },
    {
      title: "GM/GN",
      description: "Crypto never sleeps! üåû",
      emoji: "üåû"
    }
  ];

  return (
    <div className="min-h-screen bg-gradient-to-b from-yellow-300 to-yellow-400 text-gray-800 overflow-hidden">
      {/* Fun background elements */}
      <div className="fixed inset-0 pointer-events-none overflow-hidden">
        <div className="absolute top-0 left-0 w-full h-full bg-[repeating-linear-gradient(45deg,#FFD700,#FFD700_10px,#FFA500_10px,#FFA500_20px)] opacity-20" />
        {[...Array(20)].map((_, i) => (
